const {makeStyles} = require('@material-ui/core')

export const useStyles = makeStyles(() => ({
    root: {
        '& > div': {
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
        }
    },
    modalContent: {
        top: '10px'
    }
}))
